import React from "react";

   function Front() {
  return (
    <div className="MainPage flex flex-col justify-center items-center bg-gray-950 h-screen">
      <section className="flex flex-col justify-center items-center">
        <div>
          <div className="text-center">
            <h6 className="text-center mx-auto inline-block text-white max-w-md bg-gradient-to-r from-codeOrange to-purple bg-clip-text text-lg font-bold text-transparent md:text-xl">
              Change World With Web3.0
            </h6>
          </div>
          <div>
            <h1 className="mx-auto mt-2 text-white max-w-xl bg-gradient-to-r from-codeOrange to-purple text-3xl font-normal sm:max-w-2xl sm:text-5xl lg:max-w-3xl lg:text-5xl">
              Become a Future Web3 developer
            </h1>
          </div>
        </div>
      </section>
    </div>
  );
}



export default Front;
